import React from 'react';
import './Header.css';

function Header() {
  return (
    <header>
      <h1>Lista de Publicaciones</h1>
      <h2>Bienvenido a nuestro blog</h2>
      <nav>
        <ul>
          <li><a href="/">Inicio</a></li>
          <li><a href="/about">Acerca de</a></li>
          <li><a href="/contact">Contacto</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
